import React from 'react'
import trelloLogo from "../trello-logo/trello-logo-blue.png"
function SignUp() {
    return (
    <>
        <h1>Hello</h1>
        <img className="trello" src={trelloLogo}/>
        </>
    )
}

export default SignUp
